  width: 100%;
  max-width: 22rem;
  height: 12.5rem;
  padding: 0 2.5rem;
  margin-bottom: 1rem;
  background-color: var(--neutral-500);
  border-radius: 0.75rem 6rem 0.75rem 0.75rem;
  display: flex;
  flex-direction: column;
  justify-content: space-evenly;
  @media (min-width: 62rem) {
