      display: flex;
      align-items: center;
      justify-content: center;
      width: 3rem;
      height: 3rem;
      background-color: var(--neutral-600);
      border-radius: 0.5rem;
      
    }
    * + * {
      margin-left: 1rem;
    }
  }
}

