  position: relative;
  width: 100%;
  max-width: 33.75rem;
  height: 10rem;
  padding: 2rem;
  margin-bottom: 1rem;
  background-color: var(--neutral-500);
  border-radius: 0.75rem;
  display: flex;
  flex-direction: column;
  justify-content: space-evenly;
 
  @media (min-width: 62rem) {
    margin: 0;
    
  }
    .bar {
      display: inline-block;
      position: absolute;
      z-index: 3;
      left: 2px;
      top: 50%;
      width: 5rem;
      height: 10px;
      border-radius: 5px;
      background-color: #ff0000;
      overflow: hidden;
    }
    .bar, .fill {
      display: block;
      width: 0;
      height: 100%;
      background-color: #6200ee;
    }   
 
  }
  #left{
    color: green;
  }
